import { forwardRef } from 'react';
import PropTypes from 'prop-types';
// @mui
import { Box } from '@mui/material';

// ----------------------------------------------------------------------

const Page = forwardRef(({ children, title = process.env.REACT_APP_NAME, meta, ...other }, ref) => (
  <>
    <div>
        <header>
            {`${title} | ${process.env.REACT_APP_NAME}`}
        </header>
        {meta}
    </div>

    <Box ref={ref} {...other}>
      {children}
    </Box>
  </>
));

Page.propTypes = {
  children: PropTypes.node.isRequired,
  title: PropTypes.string,
  meta: PropTypes.node,
};

export default Page;
